import React from "react"

import BufferStyle from "./BufferStyle"

import Triangle from "../SVG/Triangle/Triangle"

class Buffer extends React.PureComponent{
    constructor(props) {
        super(props);
        this.state = {
          error: null,
          isLoaded: false,
          position: {
            x: this.props.x !== undefined ? this.props.x : 0,
            y: this.props.y !== undefined ? this.props.н : 0
          },

          list: this.props.list !== undefined ? this.props.list : [],
          currentItem: this.props.currentItem !== undefined ? this.props.currentItem : "",

        };
      }

      render() {
        const {x,y} = this.state
        return (
         <BufferStyle>
              <div>
                   <div>Текущий</div>
                   <div>ЛистИтем</div> 
                   <div>Выбран</div> 
                   <div>ЛистИтем</div>  
              </div>
              <Triangle   left={x} top={y} width={100} height={100} min={50} max={100} value={0}/>
         </BufferStyle>
        )
      }
}


export default Buffer;
